import React, {Component} from 'react'
import axios from "axios";
export default class Board extends Component {

    componentDidUpdate() {
        axios.get('/api/board')
            .then(res=>console.log(res.dara));
    }

    render() {
        return(
            <div className="RCA-header-container">
                <h3>공지</h3>
                <ul>
                    <li>공지 사항입니다.</li>
                </ul>
            </div>
        )
    }
}
